import Calenderr from "components/Calender/Calenderr";
export default function Calender() {
    return (
        <>
         <div className="w-full p-0 m-0">
         <div className="w-full max-w-7xl mx-auto pt-20 mt-0">


            <Calenderr />
        </div>
        </div>
        </>
    );
};
